import RemovedTodo from "./RemovedTodo"

const RemovedTodoList = (props) =>{
console.log(props)
    const removedItems = props.removedList.map((todo) => (<RemovedTodo key={todo.id} activity={todo.activity}/>))
   // const solo = <RemovedTodo activity={props.removedList[0].activity}/>
   // console.log(solo)
//console.log(removedItems)
    return(
        <Card>
<ul>{removedItems}</ul>
        </Card>
    )

}

export default RemovedTodoList
